import React from 'react'
import './OrderPlaced.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function OrderPlaced() {
    return (
        <div id="orderContainer">
            <div id="check"><i class="fas fa-check-circle"></i></div>
            <div id="check"><FontAwesomeIcon icon="fa-duotone fa-circle-exclamation" /></div>

            <div id="aboutCheck">
                <h2 style={{ color: "black" }}> Order Placed Successfully! </h2>
                <p> We've sent you an email with the Order details. </p>
            </div>
        </div>
    )
}

export default OrderPlaced
